import React, { useEffect, useState } from "react";
import axios from "axios";
import Swal from "sweetalert2";
import { useGoogleLogin } from "@react-oauth/google";
function Login() {
    const [user, setUser] = useState([]);
    const url = "https://api.trungthanhweb.com/api/";
    const login = useGoogleLogin({
      onSuccess: (codeResponse) => setUser(codeResponse),
      onError: (error) => console.log("Login Failed:", error),
    });
    console.log(user);
    const Toast = Swal.mixin({
      toast: true,
      position: "top-end",
      showConfirmButton: false,
      timer: 1700,
      timerProgressBar: true,
      didOpen: (toast) => {
        toast.addEventListener("mouseenter", Swal.stopTimer);
        toast.addEventListener("mouseleave", Swal.resumeTimer);
      },
    });

    useEffect(() => {
        if (user && user.length!=0) {
          axios
              .get(`https://www.googleapis.com/oauth2/v1/userinfo?access_token=${user.access_token}`, {
              })
              .then((res) => {
                  var email = res.data.email;
                  console.log(email);
                  axios.post(url + "checkAdmin", {
                      email: email,
                    })
                    .then((res) => {
                      if(res.data.check==true){
                        localStorage.setItem('email',email);
                        window.location.replace('/edu');
                      }else{
                        Toast.fire({
                          icon: "error",
                          title: "Vui lòng đăng nhập bằng tài khoản giảng viên",
                        });
                      }
                     
                    });
              })
              .catch((err) => console.log(err));
      }
    },
    [ user ]);
  return (
    <>
      <div className="main_content_iner ">
        <div className="container-fluid p-0">
          <div className="row justify-content-center">
            <div className="col-12">
              <div className="dashboard_header mb_50">
                <div className="row">
                  <div className="col-lg-6">
                    <div className="dashboard_header_title">
                     
                    </div>
                  </div>
                  <div className="col-lg-6">
                    <div className="dashboard_breadcam text-end">
                      <p>
                        <a href="index-2.html">Dashboard</a>{" "}
                        <i className="fas fa-caret-right" /> login
                      </p>
                    </div>
                  </div>
                </div>
              </div>
            </div>
            <div className="col-lg-12">
              <div className="white_box mb_30">
                <div className="row justify-content-center">
                  <div className="col-lg-6">
                    <div className="modal-content cs_modal">
                      <div className="modal-header justify-content-center theme_bg_1">
                        <h5 className="modal-title text_white">Log in</h5>
                      </div>
                      <div className="modal-body">
                        <form>
                          <div className="">
                            <input
                              type="text"
                              className="form-control"
                              placeholder="Enter your email"
                            />
                          </div>
                          <div className="">
                            <input
                              type="password"
                              className="form-control"
                              placeholder="Password"
                            />
                          </div>
                          <a href="#" className="btn_1 full_width text-center">
                            Log in
                          </a>
                         
                          <div className="text-center">
                            <a
                              href="#"
                              data-bs-toggle="modal"
                              data-bs-target="#forgot_password"
                              data-bs-dismiss="modal"
                              className="pass_forget_btn"
                            >
                              Forget Password?
                            </a>
                            <br />
                            <button style={{'fontSize':'22px'}} className="rounded mt-3 btn btn-warning"><i class='bx bxl-gmail'></i></button>
                          </div>
                        </form>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default Login;
